import React from "react";
import logoImg from "../../Assets/UncutLogo.png";

export default function Header() {
  return (
    <div
      style={{
        backgroundColor: "green",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: 400,
      }}
    >
      <img src={logoImg} alt="Company Logo" />
      <div></div>
    </div>
  );
}
